import { Box, Dialog, FormLabel, TextField, Typography } from '@mui/material';
import React from 'react';

const labelStyle = {mt: 1, mb: 1};
const AuthForm = () => {
  return (
    
    <Dialog open={true}>
        <Typography variant='h4' textAlign={'center'}>
          Login
        </Typography>
        <form>
          <Box padding={6} display={"flex"} flexDirection="column" width={400} margin="auto" alignContent="center">
            <FormLabel sx={labelStyle} >Email</FormLabel>
            <TextField  variant="standard" type={"email"} name="email" /> 
            <FormLabel sx={labelStyle} >Password</FormLabel>
            <TextField variant="standard" type={'password'} name="password" />
          </Box>
        </form>
    </Dialog> 
  );
};

export default AuthForm;
